import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render([
<h1>Hello world!!</h1>,
<p>Here we see the example of div tag and also see the alternate.</p>,
<h3>Now we knew that in react render method tooks only two para and we can not 
  give many elements as a single parameter</h3>,
  <p>The alternare is to show the elements in the list format</p>,
  ],
  document.getElementById('root')
);
